import React ,{Component} from 'react';


class Friends extends Component {
    render(){
        return(
            <div>
                <center>
                <font size='+1.5'>
                <h1>My Friends are:</h1>
                <h1>Chethan</h1>
                <h1>Suhas</h1>
                <h1>Yeshwanth</h1>
                </font>
                </center>
            </div>
        );
    }
}
export default Friends;
